import React from 'react'

export const Attribute = ({ attrinute, attrinuteValue }) => {
    return (
        <span className="attribute">
            {attrinute}
            <span className="equal-sign">=</span>
            <span className="attribute-value">"{attrinuteValue}"</span>
        </span>
    )
}
